import { Route, Routes } from 'react-router-dom';
import './App.css';
import Blog from './components/Blog';
import Gallery from './components/Gallery';
import Header from './components/Header';
import HeritageSites from './components/HeritageSites';
import Home from './components/Home';
import OurPride from './components/Ourpride';
import TravelWithUs from './components/TravelWithUs';
import React from 'react';
import SignUp from './components/SignUp';
import SignIn from './components/SignIn';
import StateList from './components/StateList';
import StateDetail from './components/StateDetail';


function App() {
  return <React.Fragment>
    <header>
      <Header/>
    </header>
    <main>
      <Routes>
        <Route path = '/' element={<Home/>} exact/>
        <Route path = '/heritagesites' element={<HeritageSites/>} exact/>
        <Route path = '/travelwithus' element={<TravelWithUs/>} exact/>
        <Route path = '/gallery' element={<Gallery/>} exact/>
        <Route path = '/ourpride' element={<OurPride/>} exact/>
        <Route path = '/blog' element={<Blog/>} exact/>
        <Route path = '/signup' element={<SignUp/>} exact/>
        <Route path = '/signin' element={<SignIn/>} exact/>
        <Route path = '/StateList' element={<SignIn/>} exact/>
        <Route path="/state/:stateId" component={StateDetail} />
      </Routes>
    </main>
  </React.Fragment>
}

export default App;
